class Solution {
public:
    string makeLargestSpecial(string s) {
        if (s.size() <= 2) return s;
        vector<string> tokens;
        int balance = 0, i = 0;
        for (int j = 0; j < s.size(); ++j) {
            balance += (s[j] == '1') ? 1 : -1;
